import React from "react";

const Tabs = ({color}) => {
    const [openTab,
        setOpenTab] = React.useState(1);
    return ( <> <div className="flex flex-wrap mx-auto px-12 mx-12 m-10 p-10">
        <div className="w-full md:px-10 md:mx-10">
            <ul className="flex mb-0 list-none flex-wrap pt-3 pb-4 flex-row" role="tablist">
                <li className="-mb-px mr-2 last:mr-0 flex-auto text-center">
                    <a
                        className={"text-xs font-bold uppercase px-5 py-3 shadow-lg rounded block leading-normal " + (openTab === 1
                        ? "text-white bg-" + color + "-600"
                        : "text-" + color + "-600 bg-white")}
                        onClick={e => {
                        e.preventDefault();
                        setOpenTab(1);
                    }}
                        data-toggle="tab"
                        href="#link1"
                        role="tablist">
                        Service 1
                    </a>
                </li>
                <li className="-mb-px mr-2 last:mr-0 flex-auto text-center">
                    <a
                        className={"text-xs font-bold uppercase px-5 py-3 shadow-lg rounded block leading-normal " + (openTab === 2
                        ? "text-white bg-" + color + "-600"
                        : "text-" + color + "-600 bg-white")}
                        onClick={e => {
                        e.preventDefault();
                        setOpenTab(2);
                    }}
                        data-toggle="tab"
                        href="#link2"
                        role="tablist">
                        Service 2
                    </a>
                </li>
                <li className="-mb-px mr-2 last:mr-0 flex-auto text-center">
                    <a
                        className={"text-xs font-bold uppercase px-5 py-3 shadow-lg rounded block leading-normal " + (openTab === 3
                        ? "text-white bg-" + color + "-600"
                        : "text-" + color + "-600 bg-white")}
                        onClick={e => {
                        e.preventDefault();
                        setOpenTab(3);
                    }}
                        data-toggle="tab"
                        href="#link3"
                        role="tablist">
                        Service 3
                    </a>
                </li>
            </ul>
            <div
                className="relative flex flex-col min-w-0 break-words bg-white w-full mb-6 shadow-lg rounded">
                <div className="px-4 py-5 flex-auto">
                    <div className="tab-content tab-space">
                        <div
                            className={openTab === 1
                            ? "block"
                            : "hidden"}
                            id="link1">
                            <p>
                                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus ut mi ut
                                sapien pharetra suscipit.
                                <br/><br/>
                                Orci varius natoque penatibus et magnis dis parturient montes, nascetur
                                ridiculus mus. Donec ac facilisis augue.
                            </p>
                        </div>
                        <div
                            className={openTab === 2
                            ? "block"
                            : "hidden"}
                            id="link2">
                            <p>
                                Nullam laoreet tristique massa, et ultrices odio lacinia consequat. Etiam
                                interdum accumsan posuere.
                                <br/><br/>
                                Proin porta placerat neque, venenatis aliquet mi. Praesent vitae quam sit amet
                                turpis cursus lobortis.
                            </p>
                        </div>
                        <div
                            className={openTab === 3
                            ? "block"
                            : "hidden"}
                            id="link3">
                            <p>
                                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus ut mi ut
                                sapien pharetra suscipit.
                                <br/><br/>
                                Orci varius natoque penatibus et magnis dis parturient montes, nascetur
                                ridiculus mus. Donec ac facilisis augue.
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div> </>
  );
};

export default function Services() {
  return (
    <>
      <Tabs color="indigo" />;
    </>
  );
}
